import Head from "next/head"
import {getSeoData} from "./utils"

const Index = (seoData) =>{

    return(
        <React.Fragment>
            <h1>NextJS with Dynamic SEO Page</h1>
        </React.Fragment>
    )
} 

Index.getInitialProps = ()=>{
    return getHeadData().then(data=>{
        if(data.error){
            console.log(data.error)
        }else{
            return{
                category: data.category,
                blogs: data.blogs
            }
        }
    })
}

export default Index
